import React, { Component, Fragment } from 'react';
import Video from './compoVideo';

class Resultado extends Component {
    mostrarVideos = ()=>{

        const videos = this.props.videos;

        if(videos.length === 0) return null;

        console.log(videos);

        return (
            <React.Fragment>
                <div 
                className="col-12 p-5 row">
                    {videos.map(video=> (
                        <Video 
                        key={video.id}
                        video={video}
                        />

                    ))}
                </div>

            </React.Fragment>
        )    



    }
    render(){
        return(
            <React.Fragment>
                { this.mostrarVideos() }

            </React.Fragment>
            
        );
    }
}
export default Resultado;
